import React from "react";
import ReactDOM from "react-dom";
import "./Button.css";

const Button = (props) => {
  return (
    <div
      style={{
        display: "inline-block",
      }}
    >
      <a
        class="button"
        href=""
        style={{ width: "props.width", height: props.height }}
      >
        {props.text}
      </a>
    </div>
  );
};

export default Button;
